function navigation(hypeDocument, element, event) {
	 $(document).ready(function($) {
    $('.accordion').find('.navigation-group-title').click(function(){
$(this).toggleClass('open close');

      //Expand or collapse this panel
      $(this).next().slideToggle('fast');

      //Hide the other panels
      $(".navigation-group").not($(this).next()).slideUp('fast');

    });

        $('.navigation__section').click(function(){

       $(".core-nav-off, .core-nav-on").toggleClass('core-nav-off core-nav-on');
         $(".accordion-off, .accordion-on").toggleClass('accordion-off accordion-on');


    });
  });

}
